import React from 'react';
import { Line } from 'rc-progress';

class Percentage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      html: 95,
      photoshop: 95,
      sass: 85,
      javascript: 90,
      react: 85
    }
  }

  render() {
    const { percent = 60, label = 'HTML' } = this.props

    return (
      <div className="w-100 flex items-center justify-between ph5">
        <span>
          {label}
        </span>
        <div className="w-75">
          <Line percent strokeWidth="7" trailWidth="0" strokeColor="#D3D3D3" />
        </div>
        <span>
          {percent}
        </span>
      </div>
    )
  }
}

export default Percentage
